import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
    <span class="mb-0 h1"><h1 id="nav-text"><strong>Super Clicky Game</strong></h1></span>
    </nav>
  );
}

export default Nav;
